import React, { Component } from "react";


class Home extends Component{

    componentDidMount() {
        fetch("/api/home")
            .then((res) => res.json())
            .then((data) => console.log(data.message));
    }

    render() {
        return (
            <div>
                <header>
                    <p className="display-1">{!console ? "Loading..." : console}</p>
                </header>
            </div>
        );
    }
}
export default Home;
